import React, {useState, useEffect} from 'react';
import Sidebar from './sidebar';
import {Rating} from 'react-simple-star-rating';
import axios from 'axios';

const SkillComponent = () => {
  const [rating, setRating] = useState(0);
  const [skill, setSkill] = useState('');

  const handleRating = (rating) => {
    setRating(rating);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    let data = {
      userId: localStorage.getItem('userId'),
      token: localStorage.getItem('token'),
      skill: skill,
      rating: rating,
    };

    axios
      .post('http://localhost:8083/api/v1/skill/addSkill', data)
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    callApi();
  }, []);

  var datassss = [];

  const callApi = () => {
    let data = {
      userId: localStorage.getItem('userId'),
      token: localStorage.getItem('token'),
    };

    axios
      .post('http://localhost:8083/api/v1/skill/getSkill', data)
      .then((res) => {
        console.log(res.data.data);
        datassss.push(res.data.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  let tb_data1 = datassss.map((item, index) => {
    return (
      <div class="col-md-6" key={index}>
        <div>
          <h1>{item.skillName}</h1>
          <Rating ratingValue={parseInt(item.rating)} />
        </div>
      </div>
    );
  });
  return (
    <div id="app">
      <div class="wrapper">
        <Sidebar />
        <div id="content">
          <div id="main" class="formStart">
            <header class="mb-3">
              <a href="#" class="burger-btn d-block d-xl-none">
                <i class="bi bi-justify fs-3"></i>
              </a>
            </header>

            <div class="page-content">
              <section class="row">
                <div class="col-md-12">
                  <div class="row">
                    <div class="col-md-12">
                      <div class="card">
                        <div class="card-body py-4 px-5">
                          <div class="d-flex align-items-center">
                            <div class="edit">
                              <span
                                data-toggle="modal"
                                data-target="#exampleModal"
                              >
                                <h3>Add Skill</h3>
                              </span>
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                  <div class="row">{tb_data1}</div>
                </div>
              </section>
            </div>
          </div>
        </div>
      </div>

      <div
        class="modal fade"
        id="exampleModal"
        tabindex="-1"
        role="dialog"
        aria-labelledby="exampleModalLabel"
        aria-hidden="true"
      >
        <div class="modal-dialog" role="document">
          <div class="modal-content">
            <div class="modal-header">
              <h5 class="modal-title" id="exampleModalLabel">
                Add a new skill
              </h5>
              <button
                type="button"
                class="close"
                data-dismiss="modal"
                aria-label="Close"
              >
                <span aria-hidden="true">&times;</span>
              </button>
            </div>
            <div class="modal-body">
              <form>
                <div class="form-group">
                  <label for="exampleInputEmail1">Skill</label>
                  <input
                    type="email"
                    class="form-control"
                    id="exampleInputEmail1"
                    aria-describedby="emailHelp"
                    placeholder="Enter your skill"
                    value={skill}
                    onChange={(e) => setSkill(e.target.value)}
                  />
                </div>
                <div class="form-group">
                  <label for="exampleInputEmail1">Skill Rating</label>
                  <Rating onClick={handleRating} ratingValue={rating} />
                </div>
                <button
                  onClick={handleSubmit}
                  data-dismiss="modal"
                  aria-label="Close"
                >
                  Submit
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SkillComponent;
